import React from "react";
import '../App.css';
import { Card } from "react-bootstrap";

function Home() {
    return (
        <Card>
            <Card.Header as="h1">Davis Humans Vs. Zombies</Card.Header>
            <Card.Body>Check out Davis Nerf Club!</Card.Body>
        </Card>
    );
}

export default Home;
